import React from "react";

const Card = (props) => {
  return (
    <>
      <div className="box">
            <i className="fa fa-quote-left"></i>
            <div className="para">
                <p>{props.desc}</p>
            </div>
            <hr/>
            <div className="de">

            </div>
      </div>
    </>
  );
};

export default Card;
